OncoMed Pharmaceuticals, Inc. was a public American pharmaceutical development company headquartered in [[Redwood City, California]].<ref name="leuty2007" />  The company was founded in August 2004 by two [[University of Michigan]] investigators, Michael Clarke and Max S. Wicha.<ref name="leuty2007" /><ref name="uofmhs2013pr" />  {{As of|2013}}, the company had 83 employees.<ref name="timmerman2013" />  OncoMed's drug discovery work focuses on developing "targeted antibodies against [[cancer stem cell]]s".<ref name="timmerman2013" />  The cancer stem cell technologies on which OncoMed depends are licensed from the University of Michigan where they were developed by the founders of the company.<ref name="uofmhs2013pr" />  OncoMed [[Initial public offering|went public]] in 2013 and was listed on [[NASDAQ]] under the [[stock symbol]] OMED.<ref name="timmerman2013" /><ref name="uofmhs2013pr" /> In April 2019 the company was acquired by [[Mereo BioPharma]] and delisted from the Nasdaq.
